The Saint-Maurice River flows North to South in central Quebec from Gouin Reservoir to empty into the Saint Lawrence River at Trois-Rivières, in province of Quebec, in Canada. From its source at Gouin Reservoir, located at the same latitude as the Lac Saint-Jean, the river has a total drop of about 405 meters, to finally reach the river Trois-Rivières. The river is 563 km in length and has a drainage basin of 43,300 km² (16,700 mile²). Saint-Maurice river is one of the most important tributaries of St. Lawrence river. The main tributaries of the Saint-Maurice River are: 
*  Matawin River, whose mouth is at Matawin (Hamlet); 
*  Vermillon River (La Tuque) which empties about 23 km (by water) upstream (north) of the Beaumont generating station in La Tuque; 
*  Manouane River (La Tuque) which empties about 115 km (by water) upstream (north) of La Tuque; 
*  La Trenche River (La Tuque) which empties near the La Trenche Generating Station; 
*  Croche River (La Tuque) which empties at north of La Tuque. Between Weymontachie and Trois-Rivières, the St-Maurice River has 27 tributaries identified as significant enough for downhill wood: Weymontachingue, Manouane, Little Rock, Little Flamand, Windigo, Flamand, Coucoucache, Grande Pierriche (Great Pierriche), Petite Pierriche (Little Pierriche), "La Trenche", Vermillion, Croche, Rivière-au-Lait, Bostonnais, Little Bostonnais, Small Stream, Mountain, Caribou, Rivière-aux-Rats, Wessonneau, Little Batiscan River, l'Oiseau (Bird), Bête Puante (Beast Puante), Mattawin, Mekinac, River "au Lac des Pêches" and Shawinigan River. During the 18th century, early fur traders travelled along the river. During the second half of the 19th century, logging became an important industry in the surrounding Mauricie region. For much of the 20th century, the river was used to transport logs to mills down river and it was, and still is, a major source of hydroelectric power. First communication channel in this region, the river was used by local Native Americans long before the arrival of Europeans on the spot. Early explorations by religious conversion in pain and trappers in search of furs for the trade, it was one of the primary routes of rivers in Quebec. Several municipalities have been established on its banks, thereby taking advantage of its hydroelectric power where the falls were high enough to install a dam integration an electrical generating station. Among other cities, La Tuque, Shawinigan and Trois-Rivières are the best known, are themselves located along the Route 155 which connects the St. Lawrence River to Lake St. John.

Siva River (Russian: Сива) is a river in Udmurt Republic and Perm Krai in Russia, a wikt:right bank:right tributary of the Kama River. The river is 206 kilometres (128 mi) long, and its drainage basin covers 4,870 square kilometres (1,880 sq mi). It starts in the Chastinsky District, near the village of Pikhtovka. Then it flows through the Bolshesosnovsky District of Perm Krai and the Votkinsky District of Udmurtia. Its mouth is downstream of the dam of Votkinsk Hydroelectric Station. The Siva freezes up in the second half of October and remains icebound until April. Main tributaries: 
* Left: only small insignificant rivers;  
* Right: But, Sosnova, Chyornaya, Lyp, Votka.

The Shields Branch (French: Rivière Saint-Roch in Quebec) is a tributary of the Big Black River), flowing in: 
*  Quebec (Canada): in the administrative region of Chaudière-Appalaches, in L'Islet Regional County Municipality, in the municipalities of Sainte-Perpétue, Chaudière-Appalaches, Quebec, Saint-Omer, Quebec and Saint-Pamphile, Quebec; 
*  Maine (United States): in the Aroostook County, Township T15 R15 Wels. Its course is situated between the Rochu River (or “Little Saint Rock River”) (West side) and the Gagnon River (West side). This river is especially flowing in forest area in a valley encircled by Notre Dame Mountains. From its source (47°06′58″N 69°49′37″W﻿ / ﻿47.116°N 69.827°W), in L'Islet Regional County Municipality, the river runs south and southeast across the Canada–United States border in Maine Township 15, Range 15, WELS, to the Big Black River in T 14, R 15.

The South Keltma (Russian: Южная Кельтма) is a river in Perm Krai, Russia, a left tributary of the Kama River. It is 172 kilometres (107 mi) long, and its area of drainage basin is 5,270 square kilometres (2,030 sq mi). The source of the river is located in the north of Perm Krai, near the border with the Komi Republic, in Cherdynsky District, to the north of the village of Chepets. The river freezes up in the early November and stays under the ice until the end of April. There are many swamps near the river. In 1785 – 1822 the Northern Catherine Canal was constructed. It connected the South Keltma with the North Keltma through the Dzhurich River. It was in operation only for 16 years. Main tributaries: 
* Left: Dzhurich, Olkhovka, Verhny Mal, Nizhny Mal; 
* Right: Timsher.

The Sableuse River is a watercourse in the Matapedia Valley, in administrative region of Bas-Saint-Laurent, in Quebec, Canada. Its origin lies in the Sableuse ponds in Saint-Vianney while its mouth lies in the Sableuse River Bay on Lake Matapedia. This river flows into the regional county municipalities (RCM): 
*  La Matapedia Regional County Municipality: municipality Saint-Vianney, Quebec and the unorganized territory of Lac-Matapedia, Quebec; 
*  La Matanie Regional County Municipality: municipality Sainte-Paule. This course river of the Matapedia Valley is descending towards the Southwest; it passes through the territory of Sainte-Paule and Matapedia Lake (at the Eastern boundary of the territory of Sayabec). The Sableuse River flows into the bay of Sableuse River, located on the North shore of Matapedia Lake which discharge empties on the Eastern side in the Matapedia River. The latter flows Southeast into the Matapedia Valley up to the Restigouche River which flows East up to the west bank of the Chaleur Bay. The latter opens to the East on the Gulf of Saint Lawrence.
